svg.script:
function isHidden(el)
{
   var style = window.getComputedStyle(el);
   return (style.display === 'none')
}
function changebackground() {

   document.getElementById("path6").style.fill = "yellow";
}
function changeface() {
   if(isHidden(document.getElementById("g1371")))
   {

     document.getElementById("g143778").style.display = "none";
     document.getElementById("g1371").style.display = "inline";
   }
   else
   {
     document.getElementById("g143778").style.display = "inline";
     document.getElementById("g1371").style.display = "none";
   }
}
